import React from 'react';
import "./Sixth.css";

const Sixth = () => {
  return (
    <div className='container-fluid'>
        <div className='row'>
            <div className='col-md-6 sixth'>
             <img src='../fifth1.png'/>
            </div>
            <div className='col-md-6'>
            <img src='../fifth2.jpg'/>
            </div>
        </div>
    </div>
  )
}

export default Sixth
